  name: "com.google.cloud.bigquery"
  nameWithType: "com.google.cloud.bigquery"
  fullName: "com.google.cloud.bigquery"
  type: "Namespace"
  summary: "A client for BigQuery \\u2013 A fully managed, petabyte scale, low cost enterprise data warehouse for\n analytics.\n\n <p>A simple usage example showing how to create a table if it does not exist and load data into\n it. For the complete source code see <a href=\"https://github.com/googleapis/google-cloud-java/tree/master/google-cloud-examples/src/main/java/com/google/cloud/examples/bigquery/snippets/CreateTableAndLoadData.java\">\n CreateTableAndLoadData.java</a>.\n\n <pre><code>\n BigQuery bigquery = BigQueryOptions.getDefaultInstance().getService();\n TableId tableId = TableId.of(\"dataset\", \"table\");\n Table table = bigquery.getTable(tableId);\n if (table == null) {\n   System.out.println(\"Creating table \" + tableId);\n   Field integerField = Field.of(\"fieldName\", Field.Type.integer());\n   Schema schema = Schema.of(integerField);\n   table = bigquery.create(TableInfo.of(tableId, StandardTableDefinition.of(schema)));\n }\n System.out.println(\"Loading data into table \" + tableId);\n Job loadJob = table.load(FormatOptions.csv(), \"gs://bucket/path\");\n loadJob = loadJob.waitFor();\n if (loadJob.getStatus().getError() != null) {\n   System.out.println(\"Job completed with errors\");\n } else {\n   System.out.println(\"Job succeeded\");\n }\n </code></pre>"
